h4. Changing stuff
{color:#707070}There are a few ways you can edit an issue, we'll let you know them all and then you can pick which ones you like best:{color}
* {color:#707070}Inline edit by clicking in the field you want to change. Try clicking here to edit this text.{color}
* {color:#707070}Keyboard shortcut: !e.png!{color}
* {color:#707070}Jump to field using keyboard shortcut: !comma.png!{color}
* {color:#707070}Click the Edit button in the operations bar{color}

{color:#707070}(!) *Note*: some items in the view issue page, like the status and resolution, are only changed by workflow buttons.{color}

h4. Commenting
{color:#707070}Adding comments is a great way to communicate with multiple people on an issue. As an example you'll see there's a question in the comment section at the bottom of this issue, try replying to the comment!
{color}

