h4. Now it's your turn!
{color:#707070}Now that you know the basics of JIRA, there is so much more you can do, JIRA administrators can do the following:{color}

* {color:#707070}Create your own project - return to [View All Projects|http://hazelwood.dyn.syd.atlassian.com:8087/renameuser/secure/BrowseProjects.jspa?selectedCategory=all] and use the "Create New Project" button{color}
* {color:#707070}Invite your colleagues to JIRA - keyboard shortcut: !g.png! + !g.png!, then type 'users' {color}
* {color:#707070}Delete this Demonstration Project - keyboard shortcut: !g.png! + !g.png!, then type 'projects' {color}

h4. Not an administrator?
{color:#707070}Of course not everyone viewing this project will be a JIRA Administrator, so here are some things for everyday JIRA users:{color}

* {color:#707070}Create an issue - use the keyboard shortcut: !c.png!{color}
* {color:#707070}Set your JIRA Home via your profile menu (top right){color}
* {color:#707070}Go to the Issue Navigator - keyboard shortcut: !g.png! + !i.png!{color}

