h4. Workflows. What you need to know {color:#707070}The status of an issue is driven by a workflow. A workflow defines the possible statuses that an issue can be transitioned through in its lifetime.{color}
h4. Status {color:#707070}You can view the current status of this issue in the 'Details' section above. You may also have the permission to view the workflow just beneath it, not all users will have this permission. You can change the status of this issue by clicking on the available workflow transition buttons.{color}
